<p>You can see:<br><b>User</b>: The Agency which has reserved;<br><b>Costumer</b>: Name of costumer;<br><b>Start/End Date</b>: Start/End date of the reservation;<br><b>Creation Date</b>: Date and hour in which the agency made the reservation;<br><b>Expire Date</b>: Date and hour in which the reservation will expire if it is not confirmed and soon it appears in the options-expire-list;<br><b>House</b>: House reserved.</p><p>Now you can cancel or confirm the reservation.</p>
